import React, { useContext, useState } from 'react'
import { NameContext, EmailContext, PhoneContext, AdressContext,useName, useEmail, usePhone,useAdress} from './FinalPage'



export const InputForm = () => {
    let name = useName();
    let [nameC, setName] = useState(name)
    let email = useEmail();
    const [emailC, setEmail] = useState(email)
    let phone = usePhone();
    const [phoneC, setPhone] = useState(phone)
    let adress = useAdress();
    const [adressC, setAdress] = useState(adress)
    const onNameChanged = e => {
        setName(e.target.value)
        name=''
    }
    const onEmailChanged = e => {
        setEmail(e.target.value)
        email=''
    }
    const onPhoneChanged = e => {
        setPhone(e.target.value)
        phone=''
    }
//     const onAdressChanged = e => setAdress(e.target.value)


  return (



        <form className="submitForm">
                <label htmlFor="name">Name:</label>
                <input
                    type="text"
                    id="name"
                    name="name"
                    value={nameC}
                    onChange={onNameChanged}
                />
                <label htmlFor="email">Email:</label>
                <input
                    type="text"
                    id="email"
                    name="email"
                    value={emailC}
                    onChange={onEmailChanged}
                />
                <label htmlFor="phone">Phone:</label>
                <input
                    type="text"
                    id="phone"
                    name="phone"
                    value={phoneC}
                    onChange={onPhoneChanged}
                />
                <label htmlFor="adress">Adress:</label>
                <input
                    type="text"
                    id="adress"
                    name="adress"
                    value={adressC}
                    onChange={onAdressChanged}
                />
        </form>

  )
}
